/// Imports.... 

import React, {useState} from 'react';
import Swiper from 'react-id-swiper';
import './App.scss';
import './image-gallery.scss';
import Slider from './components/Slider';
import Navbar from './components/Navbar';
import Banner from './components/Banner';
import LoginForm from './components/LoginForm';
import Footer from './components/Footer';
import { BrowserRouter as Router,Switch,Route } from 'react-router-dom';
import About from './pages/About';
import CountUp from 'react-countup';
import LoyaltyProgram from './pages/LoyaltyProgram';


// Homepage

const Home = () => {

return <div className="front_end">

    <Navbar / >

    <Slider />

    <Banner title = "Autókölcsönzés"/>

    <LoginForm form_text= "Az autókölcsönzéshez be kell jelentkeznie!" />

    <Footer />



</div>



};





const App = () => {

return <div className="front_end"> 

<Router>

<Switch>
<Route path="/" exact component = {Home} />
<Route path="/rolunk" exact component = {About} />
<Route path="/husegprogram" exact component = {LoyaltyProgram} />






</Switch>



</Router>





</div>;







};

export default App;
